ZZ Modulo(ZZ Dividendo, ZZ divisor){
    ZZ cociente = Dividendo/divisor;
    ZZ residuo = Dividendo-(divisor*cociente);
    if (residuo < 0){
        residuo += divisor;
        cociente--;
    }
    //cout << " " << Dividendo << " = " << divisor << "*" << cociente << " + " << residuo << endl;
    return residuo;
}
ZZ Algoritmo1(ZZ a, ZZ b){
    ZZ r;
    while(true){
        r = Modulo(a,b);
        if(r==0){
            return b;
        }
        a=b;
        b=r;
    }
}
ZZ Algoritmo2(ZZ a, ZZ b){
    ZZ r;
    while(true){
        r = Modulo(a,b);
        if(r==0){
            return b;
        }
        if(r > b/2){r = b-r;}
        a=b;
        b=r;
    }
}
ZZ Algoritmo3( ZZ a, ZZ b){
    if(b==0){return a;}
    return Algoritmo3(b,Modulo(a,b));
}
ZZ Algoritmo4(ZZ a, ZZ b){// que pasa
    //cout << "---------------------------------------------"<<endl;
    if(abs(b)>abs(a)){return Algoritmo4(b,a);}
    if(b==0){return a;}
    ZZ c =ZZ(2);
    if( Modulo(a,c)==0 && Modulo(b,c)==0 ){return c*Algoritmo4(a/c,b/c);}
    if( Modulo(a,c)==0 && Modulo(b,c)!=0 ){return Algoritmo4(a/c,b);}
    if( Modulo(a,c)!=0 && Modulo(b,c)==0 ){return Algoritmo4(a,b/c);}
    else{return Algoritmo4((a-b)/c,b);}
}
ZZ Algoritmo5(ZZ x, ZZ y){
    ZZ z = ZZ(2);
    ZZ g = ZZ(1);
    while( Modulo(x,z)==0 && Modulo(y,z)==0 ){
        x /= 2;
        y /= 2;
        g *= 2;
    }
    while(x != 0){
        while(Modulo(x,z)==0){ x /= z;}
        while(Modulo(y,z)==0){ y /= z;}
        ZZ t = abs(x-y)/z;
        if(x >= y){x = t;}
        else{y = t;}
        //cout << " " << x << "  " << y << endl;
    }
    return (g*y);
}
ZZ Algoritmo6(ZZ a, ZZ b){
    while(a != b){
        if(a > b){a -= b;}
        else{b -= a;}
        //cout<< a << "   " << b <<endl;
    }
    return a;
}
ZZ Algoritmo7(ZZ a, ZZ b){
    a = abs(a);b = abs(b);
    ZZ r = Modulo(a,b);
    if(r == 0){return b;}
    else{Algoritmo7(b,r);}
}
